import './App.css';
import Navigation from './components/Navigation.js'
import Titles from './components/Titles/Titles.js'
import Movies from './components/Movies.js'
import TvShows from './components/TvShows.js'
import Categories from './components/TvShows.js'

import {BrowserRouter, Route,Switch} from 'react-router-dom'

function App() {

  return (
    <div className='App'>
      <Navigation/>
      <Switch>
        <Route path='/' component={TvShows} exact />
        <Route path='/tvShows' component={TvShows}/>
        <Route path='/movies' component={Movies}/>
        <Route path='/categoreis' component={Categories}/>
      </Switch>
      <Titles/>
    </div>
  );
}

export default App;
